// 临时占位符 - 请替换为实际的js-yaml库内容
console.warn('请将此文件替换为实际的js-yaml库内容');

// 如果您无法下载，可以使用以下简化的YAML生成函数作为临时方案：
window.jsyaml = {
    dump: function(obj, options) {
        // 简化的YAML生成器 - 仅用于临时替代
        function toYaml(obj, indent) {
            indent = indent || 0;
            const spaces = '  '.repeat(indent);
            
            if (typeof obj === 'string') {
                return obj.includes('\n') ? `|\n${spaces}  ${obj.split('\n').join('\n' + spaces + '  ')}` : obj;
            }
            
            if (typeof obj === 'number' || typeof obj === 'boolean') {
                return obj.toString();
            }
            
            if (Array.isArray(obj)) {
                if (obj.length === 0) return '[]';
                return '\n' + obj.map(item => `${spaces}- ${toYaml(item, indent + 1)}`).join('\n');
            }
            
            if (typeof obj === 'object' && obj !== null) {
                const keys = Object.keys(obj);
                if (keys.length === 0) return '{}';
                return '\n' + keys.map(key => `${spaces}${key}: ${toYaml(obj[key], indent + 1)}`).join('\n');
            }
            
            return String(obj);
        }
        
        return toYaml(obj).replace(/^\n/, '');
    }
};